{
  "name": "@hedgehogcomputing/root",
  "private": true,
  "version": "0.0.0",
  "license": "Apache-2.0",
  "workspaces": [
    "packages/*"
  ],
  "devDependencies": {
    "lerna": "^6.0.1",
    "patch-package": "^6.4.7",
    "typescript": "^3.9.7"
  },
  "scripts": {
    "init": "lerna add @hedgehogcomputing/core --scope @hedgehogcomputing/lab --scope @hedgehogcomputing/canvas",
    "dev:web": "lerna exec --scope @hedgehogcomputing/lab yarn start",
    "build:core": "lerna exec --scope @hedgehogcomputing/core yarn build",
    "watch": "lerna run --parallel watch",
    "build": "lerna run build --stream",
    "postinstall": "patch-package",
    "vercel-build": "yarn global add gl node-gyp-build node-gyp"
  }
}

{
  "include": ["packages/*/src"],
  "compilerOptions": {
    "declaration": true,
    "declarationMap": true,
    "sourceMap": true,
    "strict": true,
	"skipLibCheck": true,
    "module": "esnext",
    "moduleResolution": "node",
    "esModuleInterop": true,
    "resolveJsonModule": true,
    "isolatedModules": true,
    "baseUrl": ".",
    "paths": {
      "@hedgehogcomputing/*": ["packages/*/src"]
    }
  }
}
